# require htslib bcftools

vcf_prepare () {
    VCF=$1

    if [[ ${VCF} == *.vcf ]]; then
        bgzip -f -c ${VCF} > "${VCF}.gz"
        VCF="${VCF}.gz"
    fi

    tabix -f -p vcf ${VCF}
}

